    "Fiber Optic Sensing Systems for Launch Vehicles Project",nt"tracking_summary":
    {ntt"total": 11,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:21:42.978419",nt"name": "fiber-optic-sensing-systems-for-launch-vehicles-project",nt"isopen":
    true,nt"url": null,nt"notes": "&lt;p&gt;The FOSS project primary test objectives
    are to demonstrate by flying on an Antares launch vehicle, the ability of FOSS flight
    hardware to measure strain and temperature on the launch vehicle during flight by
    measuring LOX and RP tank temperatures along the rocket longitudinal axis, strains
    on the Stage 1 thrust frame structure, and strains at several azimuths along as
    much of the vehicle length as practical in order to determine vehicle shape during
    flight.&lt;/p&gt;",nt"license_title": "U.S. Government Work",nt"extras":
